import React from 'react';
import Link from 'next/link';
import styles from './styles.module.css';

const Header = () => {

    return(
        <React.Fragment>
            <div className={styles.wrapper}>
                <div className="container mx-auto">
                    <img className="mx-auto" src="/logo_palpitebox.png" alt="Palpite-Box"/>
                </div>
            </div>
            <div className="bg-gray-300 p-4 text-center">
                <Link className="px-2 hover:border-gray-400" href="/sobre"><a>Sobre</a></Link>
                <Link href="/contato"><a>Contato</a></Link> 
                <Link href="/pesquisa"><a>Responder a pesquisa</a></Link>
            </div>
        </React.Fragment>
    );
};

export default Header
